vid colors. Bring amazing view sight. The camera with a ???°FOV lens and ??°adjustable camera gives a broad view of your memorable moment.\n??? ???? ?????? ???? ??????? ??? ??? ??????: The drone will auto-returning to the takeoff location when it\'s lost signal, or low power, don\'t have to worry about losing your drone, just enjoy the fun of flying.','Ruko',NULL,499.25,419.99,1,'Drones',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'default_listing.png','2023-08-01 02:54:34','2023-07-31 22:52:36'),(162,36,2819,'TRI-1120-XGO','Tribit XSound Go Bluetooth Speaker - 12W Portable Loud Stereo - Open Box','Smaller Size, Bigger Sound\r\nDon’t let its compact size fool you— the Tribit XSound Go provides sound that’s larger than life. Dual 6W high-performance drivers and a premium passive bass radiator create soaring highs, electrifying mids, and rich bass. Your music will be smooth and clear, even when cranked to maximum volume!\r\n\r\nIncredible 24 Hour Playtime\r\nNo outlet? No problem. A powerful, rechargeable lithium ion battery offers up to 24 hours of non-stop use. It’s the perfect speaker for traveling, camping trips, barbecues, or anywhere else you might need a little ambience.\r\n\r\nTake Your Tunes on the Road\r\nAt only 13oz, this featherlight portable speaker is easy to carry from place to place. Throw it in your backpack, purse, or beach bag for music on the go. We’ve also attached a convenient carrying strap for maximum portability.\r\n\r\nPool Party Waterproof\r\nWith top of the line IPX7 waterproofing, water won’t slow you down. It’s perfect for the pool, the shower, the backyard, and everywhere in between.\r\n\r\nWireless Bluetooth Connection\r\nAdvanced bluetooth 4.2 technology provides a completely wireless connection with an amazing 66ft range! Pairing is simple— Just enter your device’s bluetooth settings, click on “Tribit XSound Go”, and enjoy.\r\n\r\nUniversal Compatibility\r\nThe Tribit XSound Go is compatible with all bluetooth enabled devices. Pair it with your iPhone, Samsung, Amazon Echo/ Echo Dot, laptop and so much more. A 3.5 mm audio cable (not included) can be used to play audio from desktop computers, TVs, MP3 players.','Tribit',NULL,39.99,39.99,10,'Portable, Wireless & Compact Speaker Systems',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'default_listing.png','2023-08-03 18:39:36','2023-08-01 00:26:51'),(184,3,3193,'qdwdwdwqd','the catalogue','hello description','hi','Home Theatre',12.00,10.00,1,NULL,1,'2023-08-22 03:49:00','2022-04-05 07:00:00',1.00,NULL,1,'cad','wdqdqw21',12323212,'hello','world','default_listing.png','2023-09-01 01:11:39','2023-08-21 00:50:02'),(194,3,3203,'15225528','Odoland Portable LED Camping Lantern with Ceiling Fan - Hurricane Emergency Survival Kit  - Open Box','This is a very versatile light/fan for both camping and emergency situations. The light is very bright and will illuminate a camper or a small room in your house. The fan moves the air adequately to keep you cool in the heat when your power is off. Simply hang the Happy Camper Deluxe Camping Combo LED Lantern and Fan from your tent or shelter, or stand it on its base and take pleasure in hours of light and fan.','ODOLAND','Flashlights & Lanterns',19.99,14.99,37,'CAT_32085',1,'2023-08-11 06:59:59','2023-04-17 07:00:00',14.99,19.99,1,'CAD','S247433',19842236,'778862973700','UPC-A','default_listing.png','2023-08-21 05:51:05','2023-08-21 04:27:59'),(195,3,3204,'14996328','Gbateri Led Flameless Set of 3 Dripless Real Wax Flickering Pillar Candle','Do you love how calming the flame of a small candle is?\nAre you always worried though about fire danger or any dangerous accident that may happen?\nNow You Have The Solution: Meet The Gbateri Flameless Candle Set,Breathe New Life Into Your House!\nThis candle set is made from paraffin wax,however there is no burning wick,smoke or messy dripping wax.Perfect for places like bookshelves and bedrooms.','Gbateri','Candles',24.00,17.00,29,'CAT_31995',1,'2023-07-07 06:59